import ListGroup from "react-bootstrap/ListGroup";

function HeaderLinks() {
  const items = ["Projects", "Education", "Who Am I"];
  return (
    <ListGroup>
      {items.map((item) => (
        <ListGroup.Item>{item}</ListGroup.Item>
      ))}
    </ListGroup>
  );
}

export default HeaderLinks;
